const StudentTable = ({ props }) => {
  return (
    <div>
      <h3>List of Students:</h3>
      <div>
        <table border="true">
          <tr>
            <th>Name</th>
            <th>Email</th>
            <th>City</th>
          </tr>

          {props.map((std, index) => {
            return (
              <tbody key={index}>
                <tr>
                  <td>{std.name}</td>
                  <td>{std.email}</td>
                  <td>{std.city}</td>
                </tr>
              </tbody>
            );
          })}
        </table>
      </div>
    </div>
  );
};
export default StudentTable;
